We love this book written by Misty Copeland (@mistyonpointe) and illustrated by Setor Fiadzigbey (@setor_fia). I learned that I don't know how to pronounce “developpe to tendu”, “rond de jambe to tundu” or “pas de bourree”, but it’s cool to expose my children to the dance terminology. My daughters are really big fans of Mrs. Copeland which helps captivate their attention.

